  SIGNAL memory2 : ram_type ;
  SIGNAL memory3 : ram_type ;

SIGNAL ADDR_2 : unsigned ( 15 downto 0); -- adresse du pixel 
SIGNAL ADDR_W : unsigned (15 DOWNTO 0); -- compteur aidant à l'affichage

SIGNAL bouton_test_3 : std_logic;

SIGNAL bouton_test : std_logic;
signal x0 : integer ; -- position horizontale du vide 
signal y0 : integer ;-- position verticale du vide  
signal x : integer ; -- position horizontale de l'adresse pixel
SIGNAL y : integer ; -- position verticale de l'adresse pixel
signal var : integer ; -- un compteur

  ATTRIBUTE RAM_STYLE : string;
  ATTRIBUTE RAM_STYLE of memory: signal is "BLOCK"; --  ROM
  ATTRIBUTE RAM_STYLE of memory2: signal is "BLOCK"; -- RAM
  ATTRIBUTE RAM_STYLE of memory3: signal is "BLOCK"; -- RAM

BEGIN

PROCESS (CLOCK)
begin
IF (CLOCK'event AND CLOCK = '1') THEN
    if (reset ='1') then -- initialisation des compteurs
                ADDR_2 <= to_unsigned(0,16); 
                ADDR_W <= to_unsigned(0,16);
                x <= 0 ;
                y <= 0 ;
                x0<=0;
                y0<= 0;
                var <= 0 ;
                signal_led <= '0' ; -- par défaut le joueur est perdant
    else
              if ( ADDR_2 <= to_unsigned(63999,16) ) then -- incrementation de l'adresse 
                    ADDR_2 <= ADDR_2 + to_unsigned(1,16);
                    
                    if ( ((x < 319) and (y < 199)) or ((x < 319) and (y = 199)) ) then  -- définition des coordonnées des adresses 
                        x <= x + 1 ;
                        y <= y;
                    elsif (( x = 319) and (y < 199)) then
                        x <= 0 ;
                        y <= y + 1;
                    elsif (( x = 319) and (y = 199)) then
                        x <= 0 ;
                        y <= 0; 
                        ADDR_2 <= to_unsigned(0,16); 
                    else
                        x <= 0;
                        y <= 0;                                
                    end if ;                         
              else 
                    ADDR_2 <= to_unsigned(0,16);
                    x <= 0;
              end if;    
              
                        if (ADDR_2 = to_unsigned (63998,16) )then -- cet adresse est décalée de 1 en arrière de ADDR
                         ADDR_W  <= to_unsigned (0,16);
                        elsif (ADDR_2 = to_unsigned (63999,16) )then
                         ADDR_W  <= to_unsigned (1,16);                         
                        else 
                         ADDR_W  <= ADDR_2 + to_unsigned (2,16); 
                        end if;
                    
                                    bouton_test <= bouton_2;    
               if ( bouton_2 = '1' and  bouton_test = '0' ) then -- detection de front montant du bouton
                    if (x0<2) then -- la valeur 2 n'a pas de signification importante 
                        x0 <= 10 ; -- la valeur 10 indique la deuxièmes position 
                    else 
                        x0 <= 0 ; 
                    end if;
               else 
                    x0 <= x0; 
               end if;
               
               bouton_test_3 <= bouton_3;    
               
              if ( bouton_3 = '1' and  bouton_test_3 = '0' ) then -- detection de front montant du bouton
                   if (y0<2) then -- la valeur 2 n'a pas de signification importante
                    y0 <= 10 ; -- la valeur 10 indique la deuxièmes position 
                    else 
                    y0 <= 0 ; 
                    end if;
              else 
                    y0 <= y0 ; 
               end if;               

                                                      
              if(( bouton_1 = '1')) then           --- charger l'image initiale
                         data_in <= STD_LOGIC_VECTOR( memory2(to_integer(ADDR_W)));
                         data_write <= '1';
                         memory2(to_integer (unsigned (ADDR_2 ))) <= memory(to_integer(ADDR_2)); -- mémorisation de l'image initiale
                         memory3(to_integer (unsigned (ADDR_2 ))) <= memory(to_integer(ADDR_2)); -- mémorisation de l'image initiale
              elsif(( bouton_2 = '1')and( bouton_3 = '0')and ( bouton_1 = '0')and ( bouton_4 = '0')and ( bouton_5 = '0')) then  
                         data_write <= '1';
                         data_in <= STD_LOGIC_VECTOR( memory3(to_integer(ADDR_W)));
                   if ( y0 = 0   ) then -- le vide à la position 1 verticale                                                     
                        if ( (x <=159 and y <= 99 ) ) then -- position 1 horizontale
                              memory3(to_integer (unsigned (ADDR_2 + to_unsigned (160,16) ))) <= memory2(to_integer (unsigned (ADDR_2))) ;                                
                        elsif ( x > 159 and y <= 99 ) then -- position 2 horizontale
                             memory3(to_integer (unsigned (ADDR_2 - to_unsigned (160,16)))) <= memory2(to_integer (unsigned (ADDR_2))) ;
                        else    
                             memory3(to_integer (unsigned (ADDR_2))) <= memory2(to_integer (unsigned (ADDR_2))) ;
                                                          
                        end if;
                    else     -- le vide à la position 2 verticale
                        if ( (x <=159 and y > 99 and y <= 199 ) ) then-- position 1 horizontale
                              memory3(to_integer (unsigned (ADDR_2 + to_unsigned (160,16) ))) <= memory2(to_integer (unsigned (ADDR_2))) ;                                
 
                        elsif ( x > 159 and y > 99 and y <= 199 ) then -- position 2 horizontale
                             memory3(to_integer (unsigned (ADDR_2 - to_unsigned (160,16)))) <= memory2(to_integer (unsigned (ADDR_2))) ;
                        else    
                             memory3(to_integer (unsigned (ADDR_2))) <= memory2(to_integer (unsigned (ADDR_2))) ;
                                                          
                        end if;                    
                    end if ;    

                          
             elsif(( bouton_2 = '0')and( bouton_3 = '0')and ( bouton_1 = '0')and ( bouton_4 = '0')and ( bouton_5 = '0')) then -- aucun bouton de switch n'est appuyé
                        data_write <= '1';
                        data_in <= STD_LOGIC_VECTOR( memory2(to_integer(ADDR_W))); -- affichage de l'image finale
                        memory2(to_integer (unsigned (ADDR_2 ))) <= memory3(to_integer (unsigned (ADDR_2))) ; -- changement de la mémoire 2
                        
             elsif(( bouton_3 = '1')and( bouton_2 = '0')and ( bouton_1 = '0')and ( bouton_4 = '0')and ( bouton_5 = '0')) then  -- Switch vertical
                         data_write <= '1';
                         data_in <= STD_LOGIC_VECTOR( memory3(to_integer(ADDR_W)));
                    if ( x0 = 0   ) then  -- Switch vertical vide à la position horizontale 1      
                         if ( y <=99 and (x <=159) ) then 
                                memory3(to_integer (unsigned (ADDR_2 + to_unsigned (32000,16) ))) <= memory2(to_integer (unsigned (ADDR_2))) ;
                         elsif( y > 99 and (x <=159) ) then
                               memory3(to_integer (unsigned (ADDR_2 - to_unsigned (32000,16) ))) <= memory2(to_integer (unsigned (ADDR_2))) ;                             
                         else 
                               memory3(to_integer (unsigned (ADDR_2 ))) <= memory2(to_integer (unsigned (ADDR_2))) ;                              
                         end if;
                     else  -- Switch vertical vide à la position horizontale 2
                         if ( y <=99 and (x >159 and x <= 319 ) ) then
                                memory3(to_integer (unsigned (ADDR_2 + to_unsigned (32000,16) ))) <= memory2(to_integer (unsigned (ADDR_2))) ;
                         elsif( y > 99 and (x >159 and x <= 319 ) ) then
                               memory3(to_integer (unsigned (ADDR_2 - to_unsigned (32000,16) ))) <= memory2(to_integer (unsigned (ADDR_2))) ;                             
                         else 
                               memory3(to_integer (unsigned (ADDR_2 ))) <= memory2(to_integer (unsigned (ADDR_2))) ;                              
                         end if;                     
                     end if;  
                       
             else 
                data_in <= STD_LOGIC_VECTOR( memory3(to_integer(ADDR_W))); -- affichage de l'image finale
                data_write <= '1';                                                                                                                               
             end if;              
            
            if ( memory3(to_integer(ADDR_2)) = memory(to_integer(ADDR_2))) then -- comparaison de l'image finale et l'image initiale
                var <= var + 1 ; 
            else 
                var <= 0 ; 
            end if;         
            if (var >= 63999 ) then -- si les deux images sont identiques 
                signal_led <= '1' ; -- on génère le signal signal_led
            else 
                signal_led <= '0';
            end if ;            
       end if; 
        
end if;           
   
END PROCESS;

ADDR <= std_logic_vector(ADDR_2);
END Behavioral;